* {
  box-sizing: border-box;
}

html {
  --bg: #ffffff;
  --fg: #1e1e1e;
  --gray: #555;
  --light-gray: #ccc;
  --shadow: #e6e6e6;
  --success: rgb(90, 206, 132);
  --primary: #FF585D;
  --secondary: #5668E2;

  background-color: var(--bg);
  color: var(--fg);
  font-family: -apple-system, BlinkMacSystemFont, Segoe UI, Roboto, Helvetica, Arial, sans-serif;
  font-size: calc(0.7em + 0.6vh);
  line-height: 1.3;
}

body {
  margin: 0;
  padding: 1em;
}

main {
  margin: 0 auto;
  max-width: 100vh;
}

h1 {
  /* background-image: url(assets/logo.png);
  background-position: left 1em;
  background-repeat: no-repeat;
  background-size: auto 1.0em; */
  margin-top: 0;
  padding: 10vh 0 0.0em;
  text-align: left;
}

p {
  background-position: left 1em;
  background-repeat: no-repeat;
  background-size: auto 1.0em;
  margin: 1.0em 0 0.0em 1.0em;
  text-align: left;
}

.Biglabel {
  font-size: calc(0.8em + 0.5vw);
  margin: 3vh 0 1vh 1.0em;
  font-weight: bold;
}


a,
.link {
  color: var(--primary);
  text-decoration: none;
}

a:hover,
a:focus,
.link:hover,
.link:focus {
  text-decoration: underline;
}

a:active,
.link:active {
  color: var(--secondary);
}

.button_buy_sell {
  float: left;
  margin-left: 0;
  margin-right: 0;
  font: inherit;
  outline: none;
  background-color: #E256AE;
  border-radius: 5px;
  border: none;
  color: white;
  cursor: pointer;
  transition: transform 30ms;
  width: 50%;
}

.button_buy_sell:hover,
.button_buy_sell:focus {
  box-shadow: 0 0 10em rgba(255, 255, 255, 0.2) inset;
}

.button_buy_sell[disabled] {
  box-shadow: none;
  background-color: var(--light-gray);
  color: gray;
  cursor: not-allowed;
  transform: none;
}

.button_small {
  float: left;
  margin-left: 0;
  margin-right: 0;
  font: inherit;
  outline: none;
  background-color: var(--light-gray);
  border-radius: 0px;
  border: 1px;
  border-style: solid;
  color: white;
  cursor: pointer;
  transition: transform 30ms;
  width: calc(25% - 9.5px);
  padding: 0px;
}

.button_small:hover,
.button_buy_sell:focus {
  box-shadow: 0 0 10em rgba(255, 255, 255, 0.2) inset;
}


button,
input {
  font: inherit;
  outline: none;
}

button {
  background-color: var(--secondary);
  border-radius: 5px;
  border: none;
  color: #efefef;
  cursor: pointer;
  padding: 0.3em 0.75em;
  transition: transform 30ms;
}

button:hover,
button:focus {
  box-shadow: 0 0 10em rgba(255, 255, 255, 0.2) inset;
}

button:active {
  box-shadow: 0 0 10em rgba(0, 0, 0, 0.1) inset;
}

button.link {
  background: none;
  border: none;
  box-shadow: none;
  display: inline;
}

[disabled] button,
button[disabled] {
  box-shadow: none;
  background-color: var(--light-gray);
  color: gray;
  cursor: not-allowed;
  transform: none;
}

[disabled] button {
  text-indent: -900em;
  width: 2em;
  position: relative;
}

[disabled] button:after {
  content: " ";
  display: block;
  width: 0.8em;
  height: 0.8em;
  border-radius: 50%;
  border: 2px solid #fff;
  border-color: var(--fg) transparent var(--fg) transparent;
  animation: loader 1.2s linear infinite;
  position: absolute;
  top: 0.45em;
  right: 0.5em;
}

@keyframes loader {
  0% {
    transform: rotate(0deg)
  }

  100% {
    transform: rotate(360deg)
  }
}

fieldset {
  border: none;
  padding: 2em 0;
}

input {
  background-color: var(--shadow);
  border: none;
  border-radius: 5px 0 0 5px;
  caret-color: var(--primary);
  color: inherit;
  padding: 0.25em 1em;
}

input::selection {
  background-color: var(--secondary);
  color: #efefef;
}

input:focus {
  box-shadow: 0 0 10em rgba(0, 0, 0, 0.02) inset;
}

code {
  color: var(--gray);
}

li {
  padding-bottom: 1em;
}

aside {
  animation: notify ease-in-out 10s;
  background-color: var(--shadow);
  border-radius: 5px;
  bottom: 0;
  font-size: 0.8em;
  margin: 1em;
  padding: 1em;
  position: fixed;
  transform: translateY(10em);
  right: 0;
}

aside footer {
  display: flex;
  font-size: 0.9em;
  justify-content: space-between;
  margin-top: 0.5em;
}

aside footer *:first-child {
  color: var(--success);
}

aside footer *:last-child {
  color: var(--gray);
}

@keyframes notify {
  0% {
    transform: translateY(10em)
  }

  5% {
    transform: translateY(0)
  }

  95% {
    transform: translateY(0)
  }

  100% {
    transform: translateY(10em)
  }
}

