.calculation-box {
  background-image: url(assets/favicon_bw.png);
  background-position: calc(100% - 10px) calc(100% - 10px);
  background-repeat: no-repeat;
  background-size: auto 11%;
  display: inline-flex;
  flex-flow: column;
  height: 20vh;
  width: 31vh;
  position: relative;
  background-color: rgba(255, 255, 255, 1.0);
  border-width: 0px;
  color: #696969;
  text-align: left;
  border-radius: 5px;
  z-index: 1;
  box-shadow: 0px 5px 15px 0px rgba(128, 128, 128, 0.2);
  margin-right: 1vh;
  margin-top: 1vh;
  margin-bottom: 1vh;
  margin-left: 0;
}

.graph-box {
  display: inline-flex;
  flex-flow: column;
  height: 33vh;
  width: 47.25vh;
  position: relative;
  background-color: rgba(255, 255, 255, 1.0);
  border-width: 0px;
  color: #696969;
  text-align: left;
  border-radius: 5px;
  z-index: 1;
  box-shadow: 0px 5px 15px 0px rgba(128, 128, 128, 0.2);
  margin-right: 1vh;
  margin-top: 1vh;
  margin-left: 0;
}


a[href], input[type='submit'], input[type='image'], label[for], select, button, .pointer {
  cursor: pointer;
}

@media screen and (max-width: 960px) {
  .calculation-box {
    width: 45vw;
    /* The width is 100%, when the viewport is 800px or smaller */
  }

  .graph-box {
    width: 96vw;
    /* The width is 100%, when the viewport is 800px or smaller */
  }

  .button_buy_sell {
    border-radius: 0px;
  }

  .Biglabel {
    font-size: 18px;
    margin: 3vh 0 1vh 1.0em;
    font-weight: bold;
  }

  input,
  textarea {
    -webkit-appearance: none;
    border-radius: 0;
  }

}

.logo_full {
  display: block;
}

.logo_mobile {
  display: none;
}

@media screen and (max-width: 680px) {
  .calculation-box {
    width: 92vw;
    left: 0px;
    top: 0px;
  }

  .graph-box {
    width: 92vw;
    /* The width is 100%, when the viewport is 800px or smaller */
  }

  .button_buy_sell {
    border-radius: 0px;
  }

  .Biglabel {
    font-size: 18px;
    margin: 3vh 0 1vh 1.0em;
    font-weight: bold;
  }

  input,
  textarea {
    -webkit-appearance: none;
    border-radius: 0;
  }

  @media (max-width: 640px) and (min-width: 320px) {
    .logo_full {
      display: none;
    }

    .logo_mobile {
      display: block;
    }
  }

}
